package com.bituos.truckAdmin.Beans;

import java.sql.Date;
import java.util.*;

/**
 * @author cirm
*/

public class TruckTireConfigurationDetail{

	private int id; 
	private int axis_number;
	private String axis_side;
	private int tire_position;
	private String is_front_axis;
	public int getId() {
		return id;
	}
	public void setId(int id) {
		this.id = id;
	}
	public int getAxis_number() {
		return axis_number;
	}
	public void setAxis_number(int axis_number) {
		this.axis_number = axis_number;
	}
	public String getAxis_side() {
		return axis_side;
	}
	public void setAxis_side(String axis_side) {
		this.axis_side = axis_side;
	}
	public int getTire_position() {
		return tire_position;
	}
	public void setTire_position(int tire_position) {
		this.tire_position = tire_position;
	}
	public String getIs_front_axis() {
		return is_front_axis;
	}
	public void setIs_front_axis(String is_front_axis) {
		this.is_front_axis = is_front_axis;
	}
	
	
	


}
